using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace HackerRank
{
    class Program
    {
        static void Main(string[] args)
        {
            //var strings = Console.ReadLine();
            var strings = "";

            if (string.IsNullOrEmpty(strings)) return;
            //var expectedCount = Convert.ToInt32(Console.ReadLine());
            var expectedCount = 1001;
            var totalPatterns = new Dictionary<string, int>();

            for (var i = 1; i < strings.Count() + 1; i++)
            {
                var patterns = GetPatterns(strings, i);
                foreach (var p in patterns)
                {
                    if (totalPatterns.ContainsKey(p)) continue;
                    totalPatterns.Add(p, FindNumberOfMatchIslands(strings, p, expectedCount));
                }
            }

            Console.WriteLine(totalPatterns.Count(p => p.Value == expectedCount));
        }

        private static int FindNumberOfMatchIslands(string values, string pattern, int expectedMatch)
        {
            var matches = new List<Match>();
            for (var i = 0; i < values.Count() + 1 - pattern.Count(); i++)
            {
                var isMatch = true;
                for (var j = 0; j < pattern.Count(); j++)
                {
                    if (values[i + j] != pattern[j])
                    {
                        isMatch = false;
                        break;
                    }
                }
                if (matches.Count > expectedMatch) return expectedMatch + 1;
                if (isMatch)
                {
                    matches.Add(new Match { StartIndex = i, EndIndex = i + pattern.Count() - 1, Pattern = pattern });
                }
            }
            var unique = new List<Match>();
            foreach (var m in matches)
            {
                if (unique.Any(u => (u.StartIndex - 1 <= m.StartIndex && u.EndIndex + 1 >= m.StartIndex) ||
                                    (u.StartIndex - 1 <= m.EndIndex && u.EndIndex + 1 >= m.EndIndex))) continue;
                unique.Add(m);
            }
            return unique.Count;
        }

        private class Match
        {
            public int StartIndex { get; set; }
            public int EndIndex { get; set; }
            public string Pattern { get; set; }
        }

        private static IEnumerable<string> GetPatterns(string strings, int numOfLetters)
        {
            var patterns = new List<string>();
            if (strings.Count() < numOfLetters) return patterns;
            for (var i = 0; i < strings.Count() - numOfLetters + 1; i++)
            {
                var sb = strings.Substring(i, numOfLetters);

                if (patterns.Contains(sb.ToString())) continue;
                patterns.Add(sb.ToString());
            }
            return patterns;
        }
    }
}
